import React from "react";
import BootstrapTable from "react-bootstrap-table-next";
import { useState } from "react";



const Wines = () => {

    const [wines , setWines] = useState([])
  const getWines = () => {
    fetch("http://localhost:4000/getWines")
      .then((res) => res.json())
      .then((json) => {
        console.log(json);
        setWines([json])
      });
  };

  getWines()
    const products = [
      { id: 1, name: "name 1", price: 20 },
      { id: 2, name: "name 2", price: 20 },
      { id: 3, name: "name 3", price: 20 },
    ];
    const columns = [
      {
        dataField: "id",
        text: "Product ID",
      },
      {
        dataField: "name",
        text: "Product Name",
      },
      {
        dataField: "price",
        text: "Product Price",
      },
    ];
  return (
    <div>
      <BootstrapTable keyField="id" data={products} columns={wines} />
    </div>
  );
};

export default Wines;
